import styled from 'styled-components';
import { TeamItems } from './TeamItems';
import Jonathan from '../../img/s_jonathan.jpg'
import Gianmarco from '../../img/s_gianmarco.jpg'
import Laura from '../../img/s_laura.jpg'


const TeamSection = styled.div`
    padding: 100px 0;
    width: 100%;
    display: flex;
    overflow: hidden;
    height: auto;

`;
const TeamContainer = styled.div`
    width: 92%;
    margin: 0 auto;
`;
const TeamTitle = styled.h2`
    text-align: center;
    margin-bottom: 50px;

    & span{
        color: #F56362;
        font-family: 'Balsamiq Sans', cursive;
        font-size: 25px;
    }
`;
const TeamContent = styled.div`
display: grid;
grid-template-columns: repeat(3, 1fr);
gap: 30px;

`;


const Team = (props) => {
    return (
        <TeamSection>
            <TeamContainer>
                <TeamTitle>Our Creative <span>Team</span></TeamTitle>
                <TeamContent>
                    <TeamItems image={Jonathan} member='Jonathan' jobTitle='CEO/Founder' jobDesc='Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' telNummer='+41 79 300 40 00'/>
                    <TeamItems image={Gianmarco} member='Gianmarco' jobTitle='Web Entwickler' jobDesc='Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' telNummer='+41 79 540 12 00'/>
                    <TeamItems image={Laura} member='Laura' jobTitle='Web Designerin' jobDesc='Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' telNummer='+41 79 320 00 20'/>
                </TeamContent>
            </TeamContainer>
        </TeamSection>
    )
}

export default Team
